import React, {useState, useEffect} from "react";

export default function RecipeList() {
    const [recipe, setRecipe] = useState(null);

    //handle delete

    //fetch data
    useEffect(() => {
        fetch("http://localhost:8000/recipes")
        .then(res => {
            return res.json();
        })
        .then(data => {
            setRecipe(data);
        })
    })
    return (
        <div className="recipe-list">
            RecipeList
        </div>
    );
}
